import { Link } from 'react-router-dom';

const SearchResults = ({ albums, onAddToLibrary }) => {
  
    <div>
      {albums.map((album) =>
        album.title ? (
          <div key={album.id}>
            <img src={album.cover_medium} alt={album.title} />
            <h3>{album.title}</h3>
            <p>{album.artist.name}</p>
            
            <button onClick={() => onAddToLibrary(album)}>Agregar a biblioteca</button>
            <Link to={`/song/${album.id}`}>Ver detalles</Link>
          </div>
        ) : null
      )}
    </div>
  
}

export default SearchResults;
